  "title": {
    "nb": "Nordsjøløyper i Sogn og Fjordane med kartkoordinatar - WFS GetCapabilities"
  },
  "description": {
    "nb": "Nordsjøløyper i Sogn og Fjordane er stiar, vegar og ulike løyper som er lagt til rette for ferdsel til fots eller på sykkel. Dei er også kartfesta og er allereie tilrettelagt for deling etter avtale gjennom verksemdssamarbeidet Norge digitalt. Informasjonen er basert på enkle og opne (OGC) standardar. Desse data kan fritt brukast av alle som ønskjer det. (NLOD)Sogn og Fjordane fylkeskommune er ikkje ansvarleg for eventuelle feil i datagrunnlaget. Det er brukaren av tenesta som ber risikoen for eventuelle feil i sin av bruk av informasjonen. Dersom de avdekkar feil i datagrunnlaget, ber vi dykk sende e-post til den aktuelle verksemda nedanfor. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eNordsjøløyper i Sogn og Fjordane er stiar, vegar og ulike løyper som er lagt til rette for ferdsel til fots eller på sykkel. Dei er også kartfesta og er allereie tilrettelagt for deling etter avtale gjennom verksemdssamarbeidet \u003ca href\u003d\"https://www.geonorge.no/\" rel\u003d\"nofollow\"\u003eNorge digitalt\u003c/a\u003e. Informasjonen er basert på enkle og opne (OGC) standardar. Desse data kan fritt brukast av alle som ønskjer det. \u003ca href\u003d\"https://data.norge.no/nlod/no\" rel\u003d\"nofollow\"\u003e(NLOD)\u003c/a\u003e\u003c/p\u003e\u003cp\u003eSogn og Fjordane fylkeskommune er ikkje ansvarleg for eventuelle feil i datagrunnlaget. Det er brukaren av tenesta som ber risikoen for eventuelle feil i sin av bruk av informasjonen. Dersom de avdekkar feil i datagrunnlaget, ber vi dykk sende e-post til den aktuelle verksemda nedanfor.\u003c/p\u003e\u003cp\u003e \u003c/p\u003e"
